import React from "react";
import AutoCompleteResults from "./AutoCompleteResults";
import '../App.css'

const Filter = ({ handleNewSearch, autocomplete, showAutocomplete, handleFocusOff, handleFocusOn }) => {




    return (
        <div className="searchBar">
            <input onChange={handleNewSearch} onFocus={handleFocusOn} onBlur={handleFocusOff}/>


            <AutoCompleteResults autocomplete={autocomplete}/>



        </div>
    )
}

export default Filter;
